import { Sight } from "../../../generated/graphql";

export const newSight: Sight = { 
    id: 0,
    title: "",
    subtext: "",
    location: "",
    type: "",
    lat: 0.0,
    long: 0.0,
    images: [],   
}

export const formatSight = (sight: Sight) => {

    sight.__typename = undefined;
    sight.lat = parseFloat(sight.lat+"");
    sight.long = parseFloat(sight.long+"");

    return sight;
}
